<!doctype html>
<html>
  <head>
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Volley</title>
	<style>
	  html,body,#app,.main {
		  height: 99%;
	  }
	  body {
		  font-size: 18px;    
	  }
	  .players {
		  display: grid;
		  grid-template-columns: repeat(5,1fr)
	  }

	  .player {
		  border: 1px solid grey;
		  text-align: center;
		  padding: 10px;    
	  }

	  .player.selected {
		  border: 3px solid #00ff00 
	  }

	  .actions {
		  display: grid;
		  grid-template-columns: repeat(3,1fr)
	  }

	  .download{
		  width: 100%;
		  background-color: #ca70ff;
		  color: white;
		  justify-content: center;
		  align-items: center;
		  text-align:center;
		  display: flex;
	  }

	  .main {
		  display: grid;
		  grid-template-rows: 30% 60% 10% 
	  }

	  .counter {
		  font-weight: bold;
		  color: red;
	  }

	  .action {
		  justify-content: center;
		  align-items: center;
		  text-align:center;
		  background-color: #eee;
		  display: flex;
		  border: 1px solid grey;
		  font-size: 14px;
		  
	  }

	</style>
  </head>
  <body>
    <div id="app"></div>
